import logo from "./logo.svg";
import "./App.css";
import Login from "./components/Login";
import { BrowserRouter, Route } from "react-router-dom";
// import Signup from "./components/Signup";
function App() {
  return (
    <BrowserRouter>
      <Route path="/login" Component={Login}></Route>
    </BrowserRouter>
  );
}

export default App;
